import "./App.css";
import Navbar from "./Navbar";
import Footer from "./Footer";
import CityMainInfo from "./CityMainInfo";

export default function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="main-container">
          <Navbar />
          <CityMainInfo />
        </div>
        <Footer />
      </div>
    </div>
  );
}
